import React from "react";

const Projectfilmotography = () => {
    return (
        <div>
            <a href="https://annaylin.com/filmotography/">View Project</a>
            <h2>About this project</h2>
            <div className="project-details">
                <p>In November 2019, I took a black-and-white film development class at the Art Studio in UC Berkeley.
                    After returning the film camera I had rented for the class when it ended, I decided to buy my own. I
                    settled on a used Nikon N8008 film camera with a 35-80mm lens from Glass Key P.</p>
            </div>
        </div>
    );
};

export default Projectfilmotography;
